import React, { Component } from 'react';
import Song from './Song';

class Songs extends Component {

    render() {
        const { songs } = this.props
        const songList = songs.songs.map(song=> { 
        return(
            <li key={song}>
                <Song 
                song={song}
                />
            </li>
            )
        })

    return (
        <div className="SongList">
                <ul>{songList}</ul>
        </div>
        )
    }  
}

export default Songs;
